import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate, Link, useNavigate } from 'react-router-dom';
import ReactDOM from 'react-dom/client';
import SignupPage from './components/signup';
import LoginPage from './components/login';
import HomePage from './components/home';
import Dashboard from './components/dashboard';
import EventPage from './components/EventPage';
import './navbar.css';

const App = () => {
    const navigate = useNavigate();
    const [loggedIn, setLoggedIn] = useState(false);

    useEffect(() => {
        // Check if user is logged in from sessionStorage
        const isLoggedIn = sessionStorage.getItem("loggedIn") === "true";
        setLoggedIn(isLoggedIn);
    }, []);

    const handleLogout = () => {
        // Clear session storage and set login state to false
        sessionStorage.removeItem("loggedIn");
        setLoggedIn(false);
        navigate('/login'); // Redirect to login page after logout
    };

    // Component to protect routes for logged-in users
    const ProtectedRoute = ({ children }) => {
        return loggedIn ? children : <Navigate to="/login" replace />;
    };

    return (
        <div className="navbar">
            <div className="logo">Sports</div>
            <ul>
                <li><Link to="/home">Home</Link></li>
                <li><Link to="/EventPage">Events</Link></li>
                <li><Link to="/">Results</Link></li>
                <li><Link to="/">News</Link></li>
                <li><Link to="/">Athletes</Link></li>
            </ul>
            <div className="auth-links">
                {loggedIn ? (
                    <button onClick={handleLogout} className="logout-button">Logout</button>
                ) : (
                    <>
                        <Link to="/login">Login</Link>
                        <Link to="/signup">Sign Up</Link>
                    </>
                )}
            </div>
        </div>
    );
};

// Main function to wrap App with Router
const MainApp = () => (
    <Router>
        <App />
        <Routes>
            <Route path="/" element={<Navigate to="/login" replace />} />
            <Route path="/signup" element={<SignupPage />} />
            <Route path="/login" element={<LoginPage setLoggedIn={setLoggedIn} />} />

            {/* Protecting routes with ProtectedRoute */}
            <Route path="/home" element={<ProtectedRoute><HomePage /></ProtectedRoute>} />
            <Route path="/dashboard" element={<ProtectedRoute><Dashboard /></ProtectedRoute>} />
            <Route path="/EventPage" element={<ProtectedRoute><EventPage /></ProtectedRoute>} />
        </Routes>
    </Router>
);

// Render MainApp to the DOM
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<MainApp />);
